description:
Marvel Comics released Cable, a new on-going series by Duane Swierczynski and artist Ariel Olivetti. This new series directly follows the events of Messiah Complex. The series features Cable, and the messianic child's time traveling adventures. The dangers of the future and pursuit by Bishop are balanced with the humor of &quot;Cable the soldier&quot; becoming &quot;Cable the Nanny.&quot;
